import React from 'react';

// import Pool from './pool';
// import Swap from './swap';
import {
  HeadingText,
  StakingWrapper,
  TabWrapper,
  ToggleBtn,
  ToggleBtnWrapper,
} from './styled';

const SwapWrapper = () => {
  const [activeTab, setActiveTab] = React.useState('Swap');
  return (
    <StakingWrapper>
      <HeadingText>Trade on ArthSwap</HeadingText>
      <ToggleBtnWrapper>
        <ToggleBtn
          onClick={() => setActiveTab('Swap')}
          isActive={activeTab === 'Swap'}
        >
          Swap
        </ToggleBtn>
        <ToggleBtn
          onClick={() => setActiveTab('Pool')}
          isActive={activeTab === 'Pool'}
        >
          Pool
        </ToggleBtn>
      </ToggleBtnWrapper>
      {/* <TabWrapper>{activeTab === 'Swap' ? <Swap /> : <Pool />}</TabWrapper> */}
    </StakingWrapper>
  );
};

export default SwapWrapper;
